const processResultRegistration = async (
  clientEmail, passwordNew, passwordNewRepeat, history, setClassIncorrectUser,
  postChangePasswordRequest,
) => {
  const result = await postChangePasswordRequest(clientEmail, passwordNew, passwordNewRepeat);
  if (result === true) {
    history.push('/main-page');
  } if (result === 'incorrectUserOrPassword') {
    setClassIncorrectUser('notRealUser', 'userNotFoundBlock');
  }
};

export default processResultRegistration;
